DROP DATABASE IF EXISTS known;

CREATE DATABASE known;

USE known;

CREATE TABLE users (
  id int NOT NULL AUTO_INCREMENT,
  name varchar(50) NOT NULL,
  username varchar(50) NOT NULL,
  password varchar (20) NOT NULL,
  email varchar (50) NOT NULL,
  PRIMARY KEY(id)
);

CREATE TABLE companies (
    `crunchbase_uuid` VARCHAR(36) CHARACTER SET utf8 UNIQUE,
    `type` VARCHAR(12) CHARACTER SET utf8,
    `primary_role` VARCHAR(8) CHARACTER SET utf8,
    `name` VARCHAR(35) CHARACTER SET utf8,
    `crunchbase_url` VARCHAR(130) CHARACTER SET utf8,
    `homepage_domain` VARCHAR(31) CHARACTER SET utf8,
    `homepage_url` VARCHAR(64) CHARACTER SET utf8,
    `profile_image_url` VARCHAR(90) CHARACTER SET utf8,
    `facebook_url` VARCHAR(87) CHARACTER SET utf8,
    `twitter_url` VARCHAR(38) CHARACTER SET utf8,
    `linkedin_url` VARCHAR(160) CHARACTER SET utf8,
    `stock_symbol` VARCHAR(1) CHARACTER SET utf8,
    `location_city` INT,
    `location_region` VARCHAR(7) CHARACTER SET utf8,
    `location_country_code` VARCHAR(3) CHARACTER SET utf8,
    `short_description` VARCHAR(140) CHARACTER SET utf8,
    `funding_round_name` INT,
    `category_list` VARCHAR(130) CHARACTER SET utf8,
    `funding_total_usd` NUMERIC(19, 10),
    `last_funding_at` DATETIME,
    `status` VARCHAR(9) CHARACTER SET utf8
);

CREATE TABLE favorites (
  id int NOT NULL AUTO_INCREMENT,
  user_id int,
  company_id VARCHAR(36) CHARACTER SET utf8,
  notes varchar(255),
  PRIMARY KEY (id),
  FOREIGN KEY (user_id) REFERENCES users (id),
  FOREIGN KEY (company_id) REFERENCES companies (crunchbase_uuid)
);





